If you write a typescript class and define a variable in the constructor with the prefix 'public' it is the same as you would define a public property to the class. So the following typescript code... class Foo { constructor(public bar: boolean = true) {}
} class Bar { public foo: boolean; constructor(foo = true) { this.foo = foo; }
} Gets compiled to this javascript code... class Foo { constructor(bar = true) { this.bar = bar; }
} class Bar { constructor(foo = true) { this.foo = foo; }
}

