In typescript it is actually possible to reverse map from values to names in numeric enums. Here an example... enum Foo { A = 100, B = 200,
} console.log(Foo.A);
// [LOG]: 100 console.log(Foo[100]);
// [LOG]: "A" This is due to typescript compiles the enum down to the following javascript code... "use strict";
var Foo;
(function (Foo) { Foo[(Foo["A"] = 100)] = "A"; Foo[(Foo["B"] = 200)] = "B";
})(Foo || (Foo = {}));

